import React from "react";
import { Link } from "react-router-dom";
import SearchIcon from "./customicons/SearchIcon";
import avatar from "../assets/avatar.svg";
import NotificationIcon from "./customicons/NotificationIcon";

function Header() {
  return (
    <header className='header'>
      <Link className='logo-box header__logo' to='/'>
        {" "}
        Traveler
      </Link>

      <nav className=' header__nav nav '>
        <ul className='header__nav--item nav__links'>
          <li className='nav__links--item'>
            <Link to='/recreation'>Recreation Centers</Link>
          </li>
          <li className='nav__links--item'>
            <Link to='/weather'>Weather</Link>
          </li>
          <li className='nav__links--item'>
            <Link to='/hotels'>Hotels</Link>
          </li>
          <li className='nav__links--item'>
            <Link to='/travel'>Travel Advice</Link>
          </li>
        </ul>
        <input type='text' />
        <ul className='nav__shortCut'>
          <li className='nav__shortCut--item'>
            <SearchIcon className='nav__shortCut--search' />
          </li>
        </ul>
      </nav>
    </header>
  );
}

export default Header;
